import { IoMusicalNotes } from "react-icons/io5";

import * as Styled from "./index.styled";

export function Footer() {
  return (
    <footer>
      <Styled.Text>
        Enjoy Rock Heardle Check Out <IoMusicalNotes />{" "}
        <Styled.Link href="https://www.metalheardle.com">
          MetalHeardle.com
        </Styled.Link>
      </Styled.Text>
    </footer>
  );
}
